import React from 'react'
import Tiveo from "../../images/tiveo.png";

export const Lobby = () => {
    return (
        <div class="lobby">
            <div>
                <img src={Tiveo} alt="logo" width="400" height="113px" />
            </div>

        </div>
    )
}
